import React from "react";
import Slider from "react-slick";

function Slide(){

    const settings = {
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        infinite: false,
        row:1,
        slidesPerRow:1,
        responsive: []
    }
    return(
        <>
            <Slider {...settings}>
                {<img src="./images/hamburger-cheese.jpg"/>}
                {<img src="./images/hamburger-crafters.jpg"/>}
                {<img src="./images/hamburger-noir.jpg"/>}
            </Slider>
        </>
    )
}
export default Slide;
